import React from 'react'
import Banner from './sidebar'


// Define sidebar content (here it's just an empty div)


// Use a full component class to maintain visible state
export default class Site extends React.Component {
    state = {
        sidebarVisible: false
    }

    render() {
        return (
                  <Banner
                    open={ this.state.sidebarVisible }
                    onSetOpen={ this._toggleSidebar }
                    logo="GrafiTTraders"
                    url={ window.location.pathname }
                    onMenuClick={ this._openSidebar }
                    links={[
                        { "title": "Markets", "url": "https://www.google.com/search?ei=gcePXPjcBsKp_QbF0KyYCA&q=como+consumir+una+api+con+fecht+en+react" },
                        { "title": "Grafit", "url": "/another" },
                        { "title": "Suport", "url": "/children"}
                    ]} />
        )
    }


}
